import React from 'react';
import {brands} from  '../OffersData';
import classes from './Brands.module.css';


const Brands = () => {

const BrandsNav = brands.map( (item) => 
<div className={classes.brand} key={item.id}>
	<div className={classes.wrapper}>
		<div><img src={item.logo}></img></div>
    <p className={classes.title}>{item.label}</p>
		<div className={classes.button}><p>Show more</p><svg></svg></div>

	</div>
</div>

)

return (
	 <div className={classes.wrapper} >
   {BrandsNav}
	 </div>
)

}




export default Brands;



